import './card-styles.css';

const Card = ({ name, email, id}) => {
    return(
        <div className='card-div bg-blue br3 grow ma2'>
            <div className='card-div-img tc'>
                <img src={`https://robohash.org/${id}`} alt="card" />
            </div>
            <div className='tc'>
                <p>{name}</p>
                <p>{email}</p>
            </div>
        </div>
    )
};

export default Card;
